namespace RonSijm.FluidHumidifier.Factories.AppSync;

public class DataSourceFactory(string resourceName = null, Action<Humidifier.AppSync.DataSource> factoryAction = null) : ResourceFactory<Humidifier.AppSync.DataSource>(resourceName)
{

    internal InnerDataSourceOpenSearchServiceConfigFactory OpenSearchServiceConfigFactory { get; set; }

    internal InnerDataSourceEventBridgeConfigFactory EventBridgeConfigFactory { get; set; }

    internal InnerDataSourceHttpConfigFactory HttpConfigFactory { get; set; }

    internal InnerDataSourceRelationalDatabaseConfigFactory RelationalDatabaseConfigFactory { get; set; }

    internal InnerDataSourceLambdaConfigFactory LambdaConfigFactory { get; set; }

    internal InnerDataSourceDynamoDBConfigFactory DynamoDBConfigFactory { get; set; }

    internal InnerDataSourceElasticsearchConfigFactory ElasticsearchConfigFactory { get; set; }

    protected override Humidifier.AppSync.DataSource Create()
    {
        var dataSourceResult = CreateDataSource();
        factoryAction?.Invoke(dataSourceResult);

        return dataSourceResult;
    }

    private Humidifier.AppSync.DataSource CreateDataSource()
    {
        var dataSourceResult = new Humidifier.AppSync.DataSource
        {
            GivenName = InputResourceName,
        };

        return dataSourceResult;
    }
    public override void CreateChildren(Humidifier.AppSync.DataSource result)
    {
        base.CreateChildren(result);

        result.OpenSearchServiceConfig ??= OpenSearchServiceConfigFactory?.Build();
        result.EventBridgeConfig ??= EventBridgeConfigFactory?.Build();
        result.HttpConfig ??= HttpConfigFactory?.Build();
        result.RelationalDatabaseConfig ??= RelationalDatabaseConfigFactory?.Build();
        result.LambdaConfig ??= LambdaConfigFactory?.Build();
        result.DynamoDBConfig ??= DynamoDBConfigFactory?.Build();
        result.ElasticsearchConfig ??= ElasticsearchConfigFactory?.Build();
    }

} // End Of Class

